description:
Today I’m using my platform to spread awareness and hopefully wake some people up when it comes to what’s currently happening in our world. Today I’m doing a full face using ONLY black-owned makeup brands. This challenge was created by Alissa Ashley and Alyssa Forever several years ago, and today it’s time to get raw.. and real. Please watch the entire video because all proceeds will be donated to the BLM movement!

Look inspired by 🦋 https://www.instagram.com/the_brooksbrother/

🔥 PREVIOUS VIDEO • Jeffree Star CREMATED Palette REVIEW... Yikes! → https://youtu.be/OcscSR7NaBA 🔥

Some amazing organizations you guys can donate to: 
campaign zero - joincampaignzero.org 
Marsha p johnson institute - marshap.org/about-mpji 
Loveland foundation - thelovelandfoundation.org 
color of change - colorofchange.org 
NAACP legal defense fund - naacpidf.org

Make sure you subscribe to my channel and hit the notification bell, so you don’t miss any of my new videos → http://bit.ly/SubscribeNikkieTutorials

